import React, { useState } from 'react';
import './Urenregistratie.css';

const Urenregistratie = () => {
  const [registraties, setRegistraties] = useState([]);
  const [formData, setFormData] = useState({
    datum: '',
    starttijd: '',
    eindtijd: '',
    prijs: '',
    reiskosten: '',
  });

  // Handle input changes
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };

  // Handle form submit
  const handleSubmit = (e) => {
    e.preventDefault();

    // Calculate hours worked
    const start = new Date(`${formData.datum}T${formData.starttijd}`);
    const end = new Date(`${formData.datum}T${formData.eindtijd}`);
    const uren = (end - start) / (1000 * 3600);

    // Calculate total for the entry
    const nieuweRegistratie = {
      datum: new Date(formData.datum),
      starttijd: formData.starttijd,
      eindtijd: formData.eindtijd,
      prijs: parseFloat(formData.prijs),
      uur: uren,
      reiskosten: parseFloat(formData.reiskosten),
      totaal: uren * parseFloat(formData.prijs) + parseFloat(formData.reiskosten),
    };

    // Update state with the new entry
    setRegistraties([...registraties, nieuweRegistratie]);

    // Reset form
    setFormData({
      datum: '',
      starttijd: '',
      eindtijd: '',
      prijs: '',
      reiskosten: '',
    });
  };

  // Calculate total amount
  const totaalPrijs = registraties.reduce((acc, curr) => acc + curr.totaal, 0);

  // Format date
  const formatDate = (date) => {
    return date.toLocaleDateString('nl-NL', {
      day: '2-digit',
      month: 'long',
      year: 'numeric',
    });
  };

  return (
    <div className="urenregistratie">
      <h2>Urenregistratie</h2>
      {/* Form for data input */}
      <form onSubmit={handleSubmit} className="registratie-form">
        <label>
          Datum:
          <input
            type="date"
            name="datum"
            value={formData.datum}
            onChange={handleInputChange}
            required
          />
        </label>
        <label>
          Starttijd:
          <input
            type="time"
            name="starttijd"
            value={formData.starttijd}
            onChange={handleInputChange}
            required
          />
        </label>
        <label>
          Eindtijd:
          <input
            type="time"
            name="eindtijd"
            value={formData.eindtijd}
            onChange={handleInputChange}
            required
          />
        </label>
        <label>
          Prijs per uur (€):
          <input
            type="number"
            name="prijs"
            value={formData.prijs}
            onChange={handleInputChange}
            required
          />
        </label>
        <label>
          Reiskosten (€):
          <input
            type="number"
            name="reiskosten"
            value={formData.reiskosten}
            onChange={handleInputChange}
            required
          />
        </label>
        <button type="submit">Toevoegen</button>
      </form>

      {/* Table to display entries */}
      <table className="registraties-table">
        <thead>
          <tr>
            <th>Datum</th>
            <th>Starttijd</th>
            <th>Eindtijd</th>
            <th>Uren</th>
            <th>Prijs per uur (€)</th>
            <th>Reiskosten (€)</th>
            <th>Totaal (€)</th>
          </tr>
        </thead>
        <tbody>
          {registraties.map((registratie, index) => (
            <tr key={index}>
              <td>{formatDate(registratie.datum)}</td>
              <td>{registratie.starttijd}</td>
              <td>{registratie.eindtijd}</td>
              <td>{registratie.uur.toFixed(2)}</td>
              <td>{registratie.prijs.toFixed(2)}</td>
              <td>{registratie.reiskosten.toFixed(2)}</td>
              <td>{registratie.totaal.toFixed(2)}</td>
            </tr>
          ))}
          <tr className="totaal-row">
            <td colSpan="6"><strong>Totaal:</strong></td>
            <td><strong>€{totaalPrijs.toFixed(2)}</strong></td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default Urenregistratie;
